import ItemShow from "./item"; 

export default function ItemList({
category,
  notebookProduct,
  desktopProduct,
}) {
  return (
    <div>

      {
          category==="notebook"?
      (notebookProduct.map(function(product){ return <Item key={product.id}>{product.name}</Item>})):
      (
        desktopProduct.map((product)=><li key={product.id}>{product.name}</li>)
      )
      }
    </div>
  );
}
